webpackJsonp([38],{"./node_modules/json-loader/index.js!./.cache/json/known-updates-with-el-capitan-os.json":function(e,t){e.exports={data:{site:{siteMetadata:{title:"Jeffry.in",author:"Jeff Wainwright"}},markdownRemark:{id:"/Users/jwainwright/Dropbox/me/git-docs/yowainwright.github.io/src/pages/2015-09-30-known-updates-with-el-capitan.md absPath of file >>> MarkdownRemark",html:'<p>Recently, I upgraded to El Capitan. Suddenly my local websites using vagrant weren\'t working &#x26; I had to reinstall some of my ruby gems like jekyll, what I use for this blog.</p>\n<p>Below are a short list of things that helped me get back up &#x26; running again. Hope it helps you too.</p>\n<ul>\n<li>Vagrant\n<a href="https://davidturner.name/setting-up-vagrant-in-os-x-10-11-el-capitan/">Quickguide</a></li>\n</ul>\n<p>^ Follow the instructions in the link provided</p>\n<ul>\n<li>Ruby\n<a href="https://github.com/jekyll/jekyll/issues/3984">Various Ruby Updates - this link is for Jekyll</a></li>\n</ul>\n<p>^ Several ruby gems (like Jekyll) may not work not work</p>\n<p>Re-installed homebrew if you have to (copy/paste the line of code below into terminal)</p>\n<pre><code class="language-ruby">ruby -e "$(curl -fsSL https://raw.githubusercontent.com/Homebrew/install/master/install)"\n</code></pre>\n<p>Re-install ruby if you have to</p>\n<pre><code class="language-ruby">brew install ruby\n</code></pre>\n<p>Re-install your gems as needed</p>\n<pre><code class="language-ruby">gem install [gem name]\n</code></pre>',frontmatter:{title:"Known changes needed after updating to El Capitan OS",date:"September 30, 2015"}}},pathContext:{path:"/known-updates-with-el-capitan-os/"}}}});
